import DeskTopLayout from '../../components/layouts/deskTopLayout'

class Baccarat extends Component {
  render() {

    return (
      <Fragment>
        <DeskTopLayout>
          <h1>online Baccarat</h1>
          <div className='jsxStyled'>
            Styles with styled-jsx
          </div>
          <style jsx>
            {
              `.jsxStyled {
                color: 'blue';
              }`
            }
          </style>
        </DeskTopLayout>
      </Fragment>

    )
  }
}

export default Baccarat
